import {
  Route,
  Routes,
  Link,
} from 'react-router-dom';


import Landing from "./components/landing";


function App() {
  return (
    <>
    <Routes>
      <Route exact path="/"><Landing /></Route>
      {/* <Route path="/" component={Landing} /> */}
    </Routes>
    <div className="App">
      <Link to="/"> welcome </Link>
      Hello! this is Raphael...
    </div>
    </>
  );
}

export default App;
